import React from "react";

export default class ProductPage extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <main>
                <div className="side-images">
                {
                    this.props.products
                        .map(x => x
                            .map(product => product.id === window.location.href.slice(window.location.href.lastIndexOf('/') + 1)
                            && product.gallery.map(x => <img alt="" src={x}></img>)))
                }
                </div>
                <div className="product-wrapper">

                </div>
            </main>
        );
    }
}
